 def capital_indexes(s):
    result = []
    for i in range(len(s)):
        if s[i].isupper():
            result.append(i)
    return result

# Test the function
print(capital_indexes("Hello World"))  # Output: [3, 6]
print(capital_indexes("Python Programming"))  # Output: [0, 1, 5, 7, 12]
